import { InferType, s } from '@sapphire/shapeshift';

const schema = s.object({
	foo: s.string,
	bar: s.number,
	baz: s.boolean,
	qux: s.bigint,
	quux: s.date
});

type Inferredtype = InferType<typeof schema>;
// Expected type:
